import React from 'react';
import Heading from './Heading';
import './style.css'


export default function Main() {
    return (
        <>
           
            <Heading />

            <div className="containerad">
                <div className="header">
                    <h2>Train Tickets</h2>
                </div>
                <div className="illustration">
                    <img src="train_illustration.png" alt="Train Illustration" style={{ width: "100%" }} />
                </div>
                <div className="content">
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla rhoncus justo et placerat ullamcorper. Vestibulum malesuada metus nec sem congue efficitur. Nulla aliquam tincidunt volutpat. Phasellus at nisi id turpis mollis volutpat.</p>
                    <ul>
                        <li>Fast ticket sales.</li>
                        <li>Multiple payment options.</li>
                        <li>Unparalleled service at modest rates.</li>
                    </ul>
                    <h1 className="button">GET STARTED</h1>
                </div>
            </div>


            <div style={{
                maxWidth: '1200px',
                margin: '50px auto',
                padding: '20px',
                backgroundColor: '#fff',
                borderRadius: '10px',
                boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
                overflow: 'hidden'
            }}>
                <h2 style={{
                    textAlign: 'center',
                    marginBottom: '30px'
                }}>Trusted by teams in marketing agencies</h2>
                <div style={{
                    display: 'flex',
                    flexWrap: 'wrap',
                    justifyContent: 'space-around'
                }}>
                    <div style={{
                        textAlign: 'center',
                        marginBottom: '30px'
                    }}>
                        <img src="design_pikcle_logo.png" alt="Design Pickle" style={{
                            width: '100px',
                            marginBottom: '10px'
                        }} />
                        <p>Design Pickle</p>
                    </div>
                    <div style={{
                        textAlign: 'center',
                        marginBottom: '30px'
                    }}>
                        <img src="ups_logo.png" alt="UPS" style={{
                            width: '100px',
                            marginBottom: '10px'
                        }} />
                        <p>UPS</p>
                    </div>
                    <div style={{
                        textAlign: 'center',
                        marginBottom: '30px'
                    }}>
                        <img src="1800gotjunk_logo.png" alt="1-800-GOT-JUNK?" style={{
                            width: '100px',
                            marginBottom: '10px'
                        }} />
                        <p>1-800-GOT-JUNK?</p>
                    </div>
                    <div style={{
                        textAlign: 'center',
                        marginBottom: '30px'
                    }}>
                        <img src="remax_logo.png" alt="RE/MAX" style={{
                            width: '100px',
                            marginBottom: '10px'
                        }} />
                        <p>RE/MAX</p>
                    </div>
                    <div style={{
                        textAlign: 'center',
                        marginBottom: '30px'
                    }}>
                        <img src="stanford_university_logo.png" alt="Stanford University" style={{
                            width: '100px',
                            marginBottom: '10px'
                        }} />
                        <p>Stanford University</p>
                    </div>
                    <div style={{
                        textAlign: 'center',
                        marginBottom: '30px'
                    }}>
                        <img src="ironman_logo.png" alt="IRONMAN" style={{
                            width: '100px',
                            marginBottom: '10px'
                        }} />
                        <p>IRONMAN</p>
                    </div>
                </div>
                <p style={{ textAlign: 'center' }}>... plus 8,000 other small business logos you wouldn't recognize</p>
            </div>

        </>
    );
}
